import react from "react";
import Contacts from "../Contacts";

        function Note(props){
            return(
        <div className="note" contentEditable="true" spellCheck="false" >     
    <div className="row">
    <div className="col col-lg-3">
        <h1>{props.name}</h1>
        <p>{props.des}</p>
        <img src={props.img} alt="no-img" height="170px" width="170px"/>
        </div>
        </div>
        </div>
        
            );
        }

 export default Note;
